pragma solidity >=0.6.0 <0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/EnumerableSet.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import '@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol';
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./ISafetyLocker.sol";
import "../../common/Constants.sol";

contract EvnAntiBot is ISafetyLocker, Ownable {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.AddressSet;

    mapping (address=>bool) public blacklist;
    mapping (address=>bool) public superWhitelist;
    mapping (address=>bool) public whitelist;
    bool public ignoreBlacklist = false;
    address public wethPool;
    bool public isWethToken0;
    address public token;
    address public weth;

    // First few blocks limitations
    uint initBlockNo;
    uint public startTime;
    uint maxGasPrice;

    uint constant CAP_RATIO = 1; // TODO: CHANGE FOR PROD to 1!
    uint constant BLOCK_RATIO = 1;
    // uint constant CAP_RATIO = 40; // TODO: CHANGE FOR PROD to 1!
    // uint constant BLOCK_RATIO = 4;
    uint constant CAP1 = 100* 2.5 * 10 ** 18 / CAP_RATIO; //TODO: Remove 100*
    uint constant CAP2 = 100* 5 * 10 ** 18 / CAP_RATIO;
    uint constant BLOCK_GAS_PRICE_CUT_OFF = 4;
    // uint constant BLOCK_US_NO_BUY = 2 * BLOCK_RATIO;
    uint constant BLOCK_US_NO_BUY = 0 * BLOCK_RATIO;
    uint constant BLOCK_US_BUY_LIMIT = 4 * BLOCK_RATIO;
    uint constant BLOCK_ALL_BUY_LIMIT = 20 * BLOCK_RATIO;
    uint constant NO_SELL_BLOCK = 5 * BLOCK_RATIO;
    uint constant DEFAULT_MAX_GAS_PRICE = 300000000000; // 350 gwei

    function getBlockOffset() internal returns (uint) {
        uint ib = initBlockNo;
        if (ib == 0) {
            initBlockNo = block.number;
            return 0;
        }
        return block.number - initBlockNo;
    }

    function doAutoBlackList(address _address, uint blockOffset) internal {
        /*
        Auto blacklist the address in the nosell blocks
        */
        if (blockOffset < NO_SELL_BLOCK && _address != wethPool) {
            blacklist[_address] = true;
        }
    }

    // Cap on gas price? One hour beforehand ~ 350
    // Block 1 to 4, gas price limit
    // Block 1&2 and two only EVNY contract can buy cap 5ETH. Uniswap buy blocked
    // Block 3&4 Uniswap limit 2.5 ETH, website 5 ETH (evn buy)
    // Block 5 to 20, everything 5 ETH
    // After block 20, lift all caps

    // Block 3&4&5 no sell.

    function addWethPool(address _token, address _weth) external onlyOwner() {
        address pool = Constants.uniV2Factory.getPair(_token, _weth);
        if (pool == address(0)) {
            pool = Constants.uniV2Factory.createPair(_token, _weth);
        }
        wethPool = pool;
        weth = _weth;
        token = _token;
        address t0 = IUniswapV2Pair(pool).token0();
        if (t0 == _weth) {
            isWethToken0 = true;
        } else {
            isWethToken0 = false;
        }
    }

    function setIgnoreBlacklist(bool shouldIgnore) external onlyOwner() {
        ignoreBlacklist = shouldIgnore;
    }

    function addSuperWhitelist(address _address) external onlyOwner() {
        require(_address != address(0), "Address must be provided");
        superWhitelist[_address] = true;
    }

    function removeSuperWhitelist(address _address) external onlyOwner() {
        require(_address != address(0), "Address must be provided");
        delete(superWhitelist[_address]);
    }

    function addWhitelist(address _address) external onlyOwner() {
        require(_address != address(0), "Address must be provided");
        whitelist[_address] = true;
    }

    function removeWhitelist(address _address) external onlyOwner() {
        require(_address != address(0), "Address must be provided");
        delete(whitelist[_address]);
    }

    function addBlacklist(address _address) external onlyOwner() {
        require(_address != address(0), "Address must be provided");
        blacklist[_address] = true;
    }

    function removeBlacklist(address _address) external onlyOwner() {
        require(_address != address(0), "Address must be provided");
        delete(blacklist[_address]);
    }

    function open(uint _timestamp, uint _maxGasPrice) external onlyOwner() {
        require(_timestamp != 0, "Bad _timestamp");
        require(_maxGasPrice >= DEFAULT_MAX_GAS_PRICE, "_maxGasPrice too low");
        startTime = _timestamp;
        maxGasPrice = _maxGasPrice;
    }

    /**
     * Following measures are considered here:
     * 1. Only whitelist flags means only allow whitelist transactions.
     * 2. If the auto blacklist flag is set, automatically blacklist people after buy.
     * 3. If the ignore blacklist flag is set, ignore the blacklist. We blacklist offenders on the main
     *    contract and open it up here.
     * 4. If cap is set limit buy to the cap.
     * Note that this is a temporary safety locker that would be removed after a while, so we don't
     * necessarily care about gas saving.
     */
    function verifyTransfer(address source, address dest) external override {
        if (superWhitelist[source] || superWhitelist[dest]) return;
        if (source == wethPool && whitelist[dest]) { // Whitelist gets one buy
            uint256 amount = _buyAmount(source);
            require(amount<=CAP2, "AntiBot: Past limit");
            whitelist[dest] = false;
            return;
        }
        _verifyPreTransfer(source);
        _verifyPreTransfer(dest);
        uint256 amount = _buyAmount(source);
        if (amount != 0) {
            uint bo = getBlockOffset();
            doAutoBlackList(dest, bo); // Its a buy so source is the pool
            _verifyAmount(amount, bo, false);
        }
    }

    function verifyUserAddress(address user, uint256 amount) external override {
        if (superWhitelist[user]) return;
        _verifyPreTransfer(user);
        if (amount != 0) {
            uint bo = getBlockOffset();
            _verifyAmount(amount, bo, true);
        }
    }

    /**
     * Return true should shortcircuit. Returns true for whitelist
     */
    function _verifyPreTransfer(address source) internal view returns (bool) {
        if (source == wethPool) { return false; }
        bool started = startTime != 0 && block.timestamp >= startTime;
        // Check if started
        require(started, "AntiBot: not started");
        require(ignoreBlacklist || !blacklist[source], "AntiBot: Blacklist - contact team");
        return false;
    }

    // Block 1 to 4, gas price limit
    // Block 1&2 and two only EVNY contract can buy cap 5ETH. Uniswap buy blocked
    // Block 3&4 Uniswap limit 2.5 ETH, website 5 ETH (evn buy)
    // Block 5 to 20, everything 5 ETH
    // After block 20, lift all caps
    function _verifyAmount(uint256 amount, uint blockOffset, bool isLiqAdder) internal virtual
        // view
        {
        uint cap = 2 ** 128; // No cap by default
        cap = blockOffset < BLOCK_ALL_BUY_LIMIT ? CAP2 : cap;
        cap = !isLiqAdder && (blockOffset < BLOCK_US_BUY_LIMIT) ? CAP1 : cap;
        cap = !isLiqAdder && (blockOffset < BLOCK_US_NO_BUY) ? 0 : cap;
        if (blockOffset < BLOCK_GAS_PRICE_CUT_OFF) {
            require(tx.gasprice <= maxGasPrice, "AntiBot: gas price too high");
        }

        require(amount <= cap, "AntiBot: Cap for low blocks reached");
    }

    function _buyAmount(address source) internal view virtual returns (uint) {
        if (source == wethPool) {
            (uint256 reserve0, uint256 reserve1, /*uint32 _*/) = IUniswapV2Pair(wethPool).getReserves();
            uint256 reserve = isWethToken0 ? reserve0 : reserve1;
            return IERC20(weth).balanceOf(wethPool).sub(reserve);
        }
        return 0;
    }

    function IsSafetyLocker() external pure override returns(bool) { return true; }
}
